import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  App:{
      height: '100vh',
      backgroundImage: 'radial-gradient(circle at -40% -10%,#4f76f2,#0f1b41 60%)',
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  }
}));
